  \"2015-08-21T22:35:37.393578\",\n\t\"name\": \"farm-emergency-loans\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"\"The U.S. Department of Agriculture's (USDA)
  Farm Service Agency (FSA) provides emergency loans to help farmers and ranchers
  who own or operate a farm/ranch located in a county declared by the President or
  designated by the Secretary of Agriculture as a primary disaster area or quarantine
  area.rnrnEmergency loan funds may be used to:rnRestore or replace essential propertyrnPay
  all or part of production costs associated with the disaster yearrnPay essential
  family living expensesrnReorganize the farming operationrnRefinance certain debts,
  excluding real estaternrnLoan applicants may borrow up to 100 percent of their total
  actual production and/or physical losses. The maximum loan amount is $500,000.rnrnLoans
  for crops, livestock, and non-real estate losses have a repayment term usually between
  1 to 7 years depending upon the loan purpose, collateral, and repayment ability.
  Loans for physical losses to real estate normally have a 30-year repayment term,
  not to exceed 40 years.\"\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
